AddCSLuaFile()DEFINE_BASECLASS("weapon_zs_baseshotgun")SWEP.PrintName="'Quad 9' Slug Rifle"SWEP.Description="An immensely powerful rifled shotgun capable of instantly killing normal zombies on headshot thanks".." to exotic hollowed out slugs. Tampering with this weapon's precise tuning by using rounds (or certain firing techniques)".." may break the 'one hit kill' effect. Despite this, headshot damage to normals is always reported as '9999',".." likely due to the rounds' immense force breaking damage recording equipment."SWEP.Slot=3;SWEP.SlotPos=0;if CLIENT then SWEP.ViewModelFlip=false;SWEP.ViewModelFOV=50;SWEP.HUD3DBone="v_weapon.xm1014_Bolt"SWEP.HUD3DPos=Vector(-1,0,0)SWEP.HUD3DAng=Angle(0,0,0)SWEP.HUD3DScale=0.02 end;SWEP.Base="weapon_zs_baseshotgun"SWEP.HoldType="ar2"SWEP.ViewModel="models/weapons/cstrike/c_shot_xm1014.mdl"SWEP.WorldModel="models/weapons/w_shot_xm1014.mdl"SWEP.UseHands=true;SWEP.Primary.Sound=Sound("Weapon_AWP.Single")SWEP.Primary.Damage=135;SWEP.Primary.NumShots=1;SWEP.Primary.Delay=1.15;SWEP.ReloadDelay=SWEP.Primary.Delay/1.5;SWEP.SkeletalResFalloffMul=math.huge;SWEP.IgnoreDamagePenalty=true;SWEP.ResistanceAmmoAs="ignore"SWEP.Primary.ClipSize=2;SWEP.Primary.Automatic=false;SWEP.Primary.Ammo="357"SWEP.Primary.DefaultClip=10;SWEP.FireAnimSpeed=0.5;SWEP.BulletSize=3;SWEP.Primary.Gesture=ACT_HL2MP_GESTURE_RANGE_ATTACK_CROSSBOW;SWEP.ReloadGesture=ACT_HL2MP_GESTURE_RELOAD_SHOTGUN;SWEP.TracerName="GaussTracer"SWEP.ConeMax=1;SWEP.ConeMin=0.05;SWEP.NoResetHSFlag=true;SWEP.IronSightsPos=Vector()SWEP.IronSightsAng=Vector(0,-1,0)SWEP.KilliconColors=KILLICON_COLORS_CLASSIC;SWEP.WalkSpeed=SPEED_SLOWER;SWEP.Tier=5;SWEP.RemantleScrapScaling={50,100,150,200}SWEP.DismantleScrap=0;function SWEP:QualityMod(a)self.DismantleScrap=self.RemantleScrapScaling[a]or 0 end;GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_RELOAD_SPEED,0.125,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_FIRE_DELAY,-0.15,1)function SWEP:IsScoped()return self:GetIronsights()and self.fIronTime and self.fIronTime+0.25<=CurTime()end;function SWEP:SecondaryAttack()return BaseClass.BaseClass.SecondaryAttack(self)end;function SWEP:Think()if self:GetIronsights()and not self:GetOwner():KeyDown(IN_ATTACK2)then self:SetIronsights(false)end;BaseClass.Think(self)end;if CLIENT then SWEP.IronsightsMultiplier=0.25;function SWEP:GetViewModelPosition(b,c)if self:IsScoped()then return b+c:Up()*256,c end;return self.BaseClass.GetViewModelPosition(self,b,c)end;local d=Material("zombiesurvival/scope")function SWEP:DrawHUDBackground()if self:IsScoped()then local e,f=ScrW(),ScrH()local g=math.min(e,f)surface.SetMaterial(d)surface.SetDrawColor(255,255,255,255)surface.DrawTexturedRect((e-g)*0.5,(f-g)*0.5,g,g)surface.SetDrawColor(0,0,0,255)if e>g then local h=(e-g)*0.5;surface.DrawRect(0,0,h,f)surface.DrawRect(e-h,0,h,f)end;if f>g then local h=(f-g)*0.5;surface.DrawRect(0,0,e,h)surface.DrawRect(0,f-h,e,h)end end end end;function SWEP:EmitFireSound()self:EmitSound(")weapons/awp/awp1.wav",77,50,0.3,CHAN_WEAPON)self:EmitSound(")weapons/awp/awp1.wav",77,100,0.7,CHAN_USER_BASE+2)end;local i=bit.bor(DMG_DIRECT,DMG_ALWAYSGIB)function SWEP.BulletCallback(j,k,l)local m=k.Entity;if m:IsValidLivingZombie()and SERVER and j:IsHeadshot(k.HitGroup,m,l)and m:GetBossTier()<=BOSSTIER_NORMAL and gamemode.Call("PlayerShouldTakeDamage",m,j)then DMGINFO_HASHEADSHOT=true;INFDAMAGEFLOATER=true;l:SetDamageType(i)local n=1.3;local o=m:GetZombieClassTable()if o.ScalePlayerDamage then local p=l:GetDamage()o:ScalePlayerDamage(m,HITGROUP_HEAD,l)local q=l:GetDamage()n=n+1-q/p end;if o.ProcessDamage then local p=l:GetDamage()o:ProcessDamage(j,l)local q=l:GetDamage()n=n+1-q/p end;l:SetDamage(m:GetMaxHealth()*n*j:GetModVal("headshot_bonus_power"))local r=(k.HitPos-k.StartPos):Angle()local s=EffectData()s:SetEntity(m)s:SetOrigin(k.HitPos)s:SetAngles(r)s:SetMagnitude(150)util.Effect("gib_player",s,true,true)m:EmitSound(")npc/barnacle/neck_snap1.wav",78,math.random(50,60),1,CHAN_USER_BASE+1)if IsValid(m)and m:IsValidLivingZombie()then local t=Angle(-math.Rand(1,2),math.Rand(-1,1),0)t:Normalize()m:ViewPunch(t*50)end end;return l end
