ST;SWEP.Tier=5;SWEP.TracerName="tracer_hyperion"SWEP.InnateEffects={trinket_flame_rounds=0.3}SWEP.KilliconColors=BRANCH_COLOR_PYRO;GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_RELOAD_SPEED,0.037,1)GAMEMODE:AttachCustomWeaponModifier("MaxFires","Laser Duration",1,3)AccessorFuncDT(SWEP,"NextFires","Int",11)AccessorFuncDT(SWEP,"NextFiringTick","Float",11)SWEP.MaxBar=40;SWEP.WeaponBuildup={Colour={250,150,140,255},Name="Charge",Requirement=SWEP.MaxBar}function SWEP:Initialize()BaseClass.Initialize(self)self.ChargeSound=CreateSound(self,"npc/strider/charging.wav")end;function SWEP.BulletCallback(b,c,d)local e=22500;local f=math.Clamp(c.HitPos:DistToSqr(c.StartPos)-40000,0,e)local g=d:GetDamage()local h=g*(e-f)/e;d:SetDamage(g*0.6+h*0.4)end;function SWEP:EndCharge(i)self.DoCharge=nil;if i then self:TriggerWeaponBuildup()self:TakeAmmo()self:SetNextFiringTick(0)self:SetNextFires(self.MaxFires)self:EmitFireSound()return true end;self:SetWeaponBuildup(0)self:CalculateNextAttackTime(self:GetFireDelay())return false end;function SWEP:CheckCharge()local j=self:GetNextFires()if not self:CanConsumeBuildup()and self.DoCharge then self:AddWeaponBuildup(self.MaxBar/(self.ChargeTime/FrameTime()))self.ChargeSound:PlayEx(1,math.min(255,25+self:GetWeaponBuildup()/self.MaxBar*80))else self.ChargeSound:Stop()self.DoCharge=nil end;local k=self:GetOwner()if k:KeyDown(IN_RELOAD)then self:EndCharge(false)end;if self:CanConsumeBuildup()and not k:KeyDown(IN_ATTACK)then self:EndCharge(not k:GetBarricadeGhosting())end;if j>=1 and self:GetNextFiringTick()<CurTime()then self.FireAnimSpeed=0.66;self:ShootBullets(self.Primary.Damage,self.Primary.NumShots*2,self:GetCone())self.FireAnimSpeed=1;self:SetNextFires(self:GetNextFires()-1)self:GetNextFiringTick(CurTime()+0.12)if j==2 then self:EmitFireSound(j==2)end end end;function SWEP:PrimaryAttack()if self:CanReload()then self:Reload()end;if not self:CanPrimaryAttack()or self:GetWeaponBuildup()~=0 then return end;self.DoCharge=true;self:CalculateNextAttackTime(self:GetFireDelay())end;function SWEP:CanPrimaryAttack()local k=self:GetOwner()if k:IsHolding()or k:GetBarricadeGhosting()or self:GetReloadFinish()>0 then return false end;if self:Clip1()<self.RequiredClip and self:GetWeaponBuildup()==0 then local l=math.max(0.25,self.Primary.Delay)if self.DryFireSound then self:EmitSound(self.DryFireSound)end;self:SetNextPrimaryFire(CurTime()+l)return false end;return self:GetNextPrimaryFire()<=CurTime()end;function SWEP:Reload()local j=self:GetNextFires()if j>=1 or self:GetWeaponBuildup()~=0 then return end;return BaseClass.Reload(self)end;function SWEP:Holster()if self:GetNextFires()>0 or self:GetWeaponBuildup()>0 then return false end;return BaseClass.Holster(self)end;function SWEP:CanReload()if self:GetNextFires()>0 or self:GetWeaponBuildup()>0 then return false end;return BaseClass.CanReload(self)end;function SWEP:Think()self:CheckCharge()return BaseClass.Think(self)end;function SWEP:SecondaryAttack()if self:GetReloadFinish()>CurTime()then return end;if self:GetNextSecondaryAttack()>CurTime()then return end;if self:GetNextFires()>0 or self:GetWeaponBuildup()>0 then return end;local k=self:GetOwner()self:SendWeaponAnim(ACT_VM_HITCENTER)self:SetNextSecondaryAttack(CurTime()+self:SequenceDuration())local m=Angle(util.SharedRandom("p",3,5),util.SharedRandom("y",-2,2),0)k:ViewPunch(m)self:EmitSound("weapons/foley/heavy2.ogg",MELEE_SWING_ATTEN,math.random(95,105))self:EmitSound("weapons/zs_machete/machete_stabby.ogg",MELEE_SWING_ATTEN,math.random(90,100),MELEE_SWING_VOL,CHAN_WEAPON+1)if IsFirstTimePredicted()then self:SetMelee(true)self:MeleeSwing(self.Primary.Damage*2,74,1,false,0)self:SetMelee(false)end;k:DoAnimationEvent(ACT_HL2MP_GESTURE_RANGE_ATTACK_MELEE2)end;function SWEP:PlayHitSound()self:EmitSound(")physics/metal/metal_canister_impact_hard"..math.random(3)..".wav",MELEE_HITWORLD_ATTEN,math.Rand(86,90),MELEE_HITWORLD_VOL,CHAN_WEAPON)end;function SWEP:PlayHitFleshSound()self:EmitSound(")physics/body/body_medium_break"..math.random(2,4)..".wav",MELEE_HIT_ATTEN,math.Rand(86,90),MELEE_HIT_VOL,CHAN_WEAPON)end;function SWEP:EmitFireSound(n)local o=n and 3 or 0;if not n then self:EmitSound("weapons/sg552/sg552-1.wav",80,65,0.9,CHAN_WEAPON+6)end;self:EmitSound("weapons/zs_asmd/main3.ogg",80,80,0.9,CHAN_WEAPON+o)self:EmitSound("weapons/zs_dds/zs_raygun.ogg",80,55,0.75,CHAN_WEAPON+1+o)self:EmitSound("weapons/zs_dds/zs_raygun.ogg",80,56,0.75,CHAN_WEAPON+2+o)end;function SWEP:EmitReloadSound()if IsFirstTimePredicted()then self:EmitSound("vehicles/tank_readyfire1.wav",75,60,1,CHAN_WEAPON+21)self:EmitSound("weapons/zs_dds/zs_rayre.ogg",75,74,0.5,CHAN_WEAPON+22)end end;if CLIENT then local p=0;function SWEP:HandleGhostLerp(q,r,s)if self:GetOwner():GetBarricadeGhosting()or self:GetReloadFinish()>0 then p=math.min(1,p+s*0.1)elseif p>0 then p=math.max(0,p-s*0.25)end;if p>0 then r:RotateAroundAxis(r:Up(),-30*p)r:RotateAroundAxis(r:Right(),-20*p)end;return q,r end end;SWEP.PenTaper=0.7;function SWEP:ShootBullets(...)if math.random()<0.67 then self.Pens=1 else self.Pens=nil end;return BaseClass.ShootBullets(self,...)end
