AddCSLuaFile()SWEP.PrintName="Push Broom"SWEP.Description="BrooooooooooOOOOOOOOOOOOOM! Press RELOAD to shunt your enemies away with vigor!\nBeing in frenzy gives you agility and increased melee knockback."if CLIENT then SWEP.ViewModelFOV=70;SWEP.ShowViewModel=false;SWEP.ShowWorldModel=false;SWEP.VElements={["base"]={type="Model",model="models/props_c17/pushbroom.mdl",bone="ValveBiped.Bip01_R_Hand",rel="",pos=Vector(1.694000005722,1.3689999580383,8.6770000457764),angle=Angle(-62.936000823975,-82.144996643066,123.3450012207),size=Vector(0.5,0.69999998807907,0.6),color=Color(255,255,255,255),surpresslightning=false,material="",skin=0,bodygroup={}}}SWEP.WElements={["base"]={type="Model",model="models/props_c17/pushbroom.mdl",bone="ValveBiped.Bip01_R_Hand",rel="",pos=Vector(3,1,5),angle=Angle(247,90,283),size=Vector(0.75,0.75,0.75),color=Color(255,255,255,255),surpresslightning=false,material="",skin=0,bodygroup={}}}end;SWEP.Base="weapon_zs_basemelee"DEFINE_BASECLASS("weapon_zs_basemelee")SWEP.HoldType="melee2"SWEP.DamageType=DMG_CLUB;SWEP.ViewModel="models/weapons/c_sledgehammer/c_sledgehammer.mdl"SWEP.WorldModel="models/weapons/w_crowbar.mdl"SWEP.UseHands=true;SWEP.MeleeDamage=83;SWEP.MeleeRange=73;SWEP.MeleeSize=1.7;SWEP.MeleeKnockBack=100;SWEP.MeleeKnockbackDamageMultiplier=1.25;SWEP.Primary.Delay=0.84;SWEP.Tier=2;SWEP.WalkSpeed=SPEED_SLOW;SWEP.SwingRotation=Angle(0,-90,-60)SWEP.SwingOffset=Vector(0,30,-40)SWEP.SwingTime=0.4;SWEP.SwingHoldType="melee"SWEP.BlockRotation=Angle(0,20,-60)SWEP.BlockOffset=Vector(-5,7,10)SWEP.Stability=WEAPON_STABILITY_WEAK;SWEP.BlockReduction=WEAPON_BLOCK_REDUCTION_STRONG;SWEP.AllowQualityWeapons=true;SWEP.StaminaUsage=0.07875;SWEP.CostMarkOfPain=100;SWEP.BuffDuration=7;SWEP.WeaponBuildup={Colour={229,204,201,255},Name="Hits",NameFull="Reload: Broom Frenzy",Requirement=100}GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_RANGE,2.5,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_KNOCK,30,3)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_BUFF_DURATION,1)local a=GAMEMODE:AddNewRemantleBranch(1,"Sweeping Broom","Attack to sweep zombies around you with a constant stream of damage. Inflicts double damage to single targets. Hitting zombies fills a meter and upon meter use, grants strength. Deals no knockback.",function(b)b.MeleeDamage=b.MeleeDamage*0.16;b.CleaveTaper=0.45;b.NextCycloneHit=0;b.CanCyclone=true;b.Primary.Delay=b.Primary.Delay*0.152/0.9;b.MeleeKnockBack=b.MeleeKnockBack*0;b.WeaponBuildup={Colour={229,204,201,255},Name="Melee Hits",NameFull="Bash: Strength",Requirement=100}if CLIENT then b.VElements["base"].color=Color(210,180,140,255)b.WElements["base"].color=Color(210,180,140,255)b.ViewModelBoneMods={["ValveBiped.Bip01_Spine4"]={scale=Vector(1,1,1),pos=Vector(0,0,0),angle=Angle(0,0,0)}}local c=table.FullCopy(b.VElements["base"])function b:ViewModelDrawn()BaseClass.ViewModelDrawn(self)local d=self:GetOwner():GetStatus("cyclone")local e=d and RealTime()*1800 or 0;self.ViewModelBoneMods["ValveBiped.Bip01_Spine4"].angle=Angle(0,0,e)if IsValid(d)then self.VElements["base"].bone="ValveBiped.Bip01_R_Hand"self.VElements["base"].angle=Angle(40,0,-90)else self.VElements["base"].bone=c.bone;self.VElements["base"].angle=c.angle end end end;function b:PlayHitFleshSound()self:EmitSound("physics/wood/wood_plank_impact_hard"..math.random(4)..".wav",45,math.random(75,80))end;function b:OnMeleeHit(f,g,h)local d=self:GetOwner():GetStatus("cyclone")if IsValid(f)and f:IsPlayer()and d then self:AddWeaponBuildup(3)end end;function b:BashEffect(h,i)local j=self:GetOwner()if IsValid(i)and i:IsPlayer()then if self:GetWeaponBuildup()>self.WeaponBuildup.Requirement*0.8 then self:DoConsumeBuildup(true)j:GiveStatus("buff_strength",8)end;local k=24*self:GetWeaponBuildup()/self.WeaponBuildup.Requirement;i:AddLegDamageExt(k,self:GetOwner(),self,SLOWTYPE_MECHANICAL)i:AddArmDamage(k)self:SetWeaponBuildup(self:GetWeaponBuildup()*0.1)end end;function b:CanBlock()local j=self:GetOwner()return not IsValid(j:GetStatus("cyclone"))end;function b:PrimaryAttack()if self:IsBlocking()then if CurTime()>self:GetBashEnd()then self:Bash()self:SetWeaponBuildup(self:GetWeaponBuildup()*0.9)end;return end;if not self:CanPrimaryAttack()then return end;local j=self:GetOwner()local l=j:GiveStatus("cyclone",b.Primary.Delay)if l then l.Weapon=self end end;function b:ThinkExtend()local j=self:GetOwner()if j:GetStatus("cyclone")and CurTime()>=self.NextCycloneHit then self.NextCycloneHit=CurTime()+self:GetFireDelay()local m=j:WorldSpaceCenter()local n=self:GetMeleeRange()local o={}for p,i in pairs(util.BlastAlloc(self,j,m,n,1,1,TEAM_HUMAN,0,16,true))do if i and i:IsValidLivingZombie()and WorldVisible(m,i:NearestPoint(m))then local q=i:NearestPoint(m)local r={AllSolid=false,Contents=1073741825,DistFlags=0,Entity=i,Fraction=m:DistToSqr(q)/n^2,FractionLeftSolid=0,Hit=true,HitBox=0,HitBoxBone=0,HitGroup=0,HitNoDraw=false,HitNonWorld=true,HitNormal=(m-q):GetNormalized(),HitPos=q,HitSky=false,HitTexture="**studio**",HitWorld=false,MatType=70,Normal=(q-m):GetNormalized(),PhysicsBone=1,StartPos=m,StartSolid=false,SurfaceFlags=32768,SurfaceProps=39,extended=false}o[#o+1]=r end end;self.IgnoreMeleeHitRegions=true;self:ResolveCleaveSwing(o,#o==1 and 2 or 1,true,true,self.MeleeDamage,self:IsHeavy())self.IgnoreMeleeHitRegions=nil end end;function b:OnAssist()end;function b:Reload()end end)a.CollectiveName="Sweeping"a.BranchDisabled=true;GAMEMODE:AttachWeaponModifierToBranch(a,WEAPON_MODIFIER_MELEE_RANGE,2.5,1)a=GAMEMODE:AddNewRemantleWep("weapon_zs_mop")a.CollectiveName="Janitorial Mop"a.Killicon="weapon_zs_mop"SWEP.RanMultiply=false;SWEP.ResetKnockbackTimer=0;function SWEP:OnWeaponBuildupUse()local j=self:GetOwner()j:GiveStatus("buff_agility",self.BuffDuration)if not self.RanMultiply then self.MeleeKnockBack=self.MeleeKnockBack*2.15;self.RanMultiply=true end;self.ResetKnockbackTimer=CurTime()+8 end;function SWEP:ThinkExtend()if self.RanMultiply and self.ResetKnockbackTimer<CurTime()then self.MeleeKnockBack=self.MeleeKnockBack/2;self.RanMultiply=false end end;function SWEP:Reload()self:TriggerWeaponBuildup()end;function SWEP:OnMeleeHit(f,g,h)if f:IsValidPlayer()and not self:GetOwner():GetStatus("buff_agility")then self:AddWeaponBuildup(self:IsHeavy()and 15 or 10)end end;function SWEP:PlaySwingSound()self:EmitSound(")weapons/iceaxe/iceaxe_swing1.wav",MELEE_SWING_ATTEN,math.Rand(60,65),MELEE_SWING_VOL,CHAN_WEAPON)end;function SWEP:PlayHitSound()self:EmitSound(")physics/wood/wood_plank_impact_hard"..math.random(4)..".wav",MELEE_HITWORLD_ATTEN,math.random(75,80),MELEE_HITWORLD_VOL,CHAN_WEAPON)end;function SWEP:PlayHitFleshSound()self:EmitSound(")physics/wood/wood_plank_impact_hard"..math.random(4)..".wav",MELEE_HIT_ATTEN,math.random(75,80),MELEE_HIT_VOL,CHAN_WEAPON)end
