d(a)self.Tier=a+1;self.DismantleScrap=self.RemantleScrapScaling[a]or 20;self.EffectiveRoundTrinketTier=self.Tier;self.RoundEffectsMultiplier=self.Tier;self.InnateEffects={trinket_ice_rounds=2-self.Tier*0.2}end;function SWEP:EmitStartFiringSound()self:EmitSound("ambient/water/water_spray"..math.random(3)..".wav",75,math.random(60,70))end;function SWEP:Initialize()self.FiringSound=CreateSound(self,"npc/env_headcrabcanister/hiss.wav")if CLIENT then self.VentingSound=CreateSound(self,"ambient/nature/water_streamloop3.wav")end;self:SetWeaponBuildup(1)BaseClass.Initialize(self)end;function SWEP:PrimaryAttack()if not self:CanPrimaryAttack()then return end;self:CalculateNextAttackTime(self:GetFireDelay())BaseClass.TakeAmmo(self)local b=self:GetWeaponBuildup()self.Primary.ProjVelocity=100+self.MaxVelocity*b;self:ShootBullets(math.max(b>0.75 and self.Primary.Damage or self.Primary.Damage*(b+0.15),0),self.Primary.NumShots,self:GetCone())self:SetWeaponBuildup(math.max(b-0.02,0))self.IdleAnimation=CurTime()+self:SequenceDuration()if self:GetGunState()~=1 then if IsFirstTimePredicted()then self:EmitStartFiringSound()end;self:SetGunState(1)end end;function SWEP:Holster()self:StopSoakerSounds()return BaseClass.Holster(self)end;function SWEP:OnRemove()BaseClass.OnRemove(self)self:StopSoakerSounds()end;function SWEP:SecondaryAttack()if self:GetGunState()==0 and self:GetWeaponBuildup()~=1 then self:SetGunState(2)self:EmitSound("ambient/machines/thumper_startup1.wav",60,140)end end;function SWEP:ManageWaterPressure()local c=self:GetOwner()if c and c:IsValid()then if self:GetGunState()==1 then local b=self:GetWeaponBuildup()self.FiringSound:PlayEx(0.6,20+80*b)if b==0 then self:SetGunState(2)self:EmitSound("ambient/machines/thumper_startup1.wav",60,140)end elseif self:GetGunState()==2 then self.FiringSound:Stop()if CLIENT then self.VentingSound:PlayEx(0.6,255+CurTime()%1)end;local d=CurTime()if self.LastCharge+self.PressureChargeDelay<d then self:AddWeaponBuildup(0.03+0.03*self.PressureChargeBonus)self.LastCharge=d end;if self:GetWeaponBuildup()==1 then self:SetGunState(0)self:EmitSound("ambient/machines/thumper_top.wav",65,160)end else self:StopSoakerSounds()end else self:StopSoakerSounds()end end;function SWEP:OnZombieKilled(e)local c=self:GetOwner()GAMEMODE:CallSeasonalEvent("PlayerSoakerKill",c)end;function SWEP:StopSoakerSounds()self.FiringSound:Stop()if CLIENT then self.VentingSound:Stop()end end;function SWEP:Think()BaseClass.Think(self)if self:GetGunState()==1 and CurTime()>=self:GetNextPrimaryFire()+0.1 then self:SetGunState(0)end;self:ManageWaterPressure()end;function SWEP:Reload()self:SecondaryAttack()BaseClass.Reload(self)end;function SWEP:CanPrimaryAttack()if self:Clip1()<self.RequiredClip then return false end;if self:GetPrimaryAmmoCount()<=0 or self:GetGunState()==2 then return false end;if self:GetOwner():IsHolding()or self:GetOwner():GetBarricadeGhosting()or self:GetReloadFinish()>0 then return false end;return self:GetNextPrimaryFire()<=CurTime()end;function SWEP:SetGunState(f)self:SetDTInt(1,f)end;function SWEP:GetGunState(f)return self:GetDTInt(1)end;function SWEP:SetWaterPressure(b)self:SetDTFloat(8,water)end;function SWEP:GetWaterPressure()return self:GetDTFloat(8)end
