;self.ShouldEject=false end;function SWEP:FireAnimationEvent(h,i,j,k)if j==20 then if self.ShouldEject then self:ForceShellEjection()end;return true end end;local l=0;local m=LerpVector;local n=LerpAngle;local o=Vector(1,0,0)local p=Vector(0,1,0)function SWEP:PreDrawViewModel(e)BaseClass.PreDrawViewModel(self,e)if self:IsReloading()then l=math.min(1,l+RealFrameTime()*2)elseif l>0 then l=math.max(0,l-RealFrameTime()*3)end;self.ReloadLerp=l;if self.ReloadLerp and self.ViewModelBoneMods then for a,b in pairs(self.ViewModelBoneMods)do if b and b.def_pos and b.pos_reload then b.pos=m(self.ReloadLerp,b.def_pos,b.pos_reload)end;if b and b.def_angle and b.angle_reload then b.angle=n(self.ReloadLerp,b.def_angle,b.angle_reload)end end end;local i=self.VElements["tube"].angle;local q=self:IsReloading()local r=self.ShellEjectTime and self.ShellEjectTime-0.1>=CurTime()local s=self.FireAnimationTime and self.FireAnimationTime-0.4>=CurTime()i.yaw=math.Approach(i.yaw,q and-23 or r and-23 or 0,RealFrameTime()*(r and 500 or 200))if self.ViewModelBoneMods then local t=self.ViewModelBoneMods["ValveBiped.Bip01_L_Forearm"]if t then t.angle.p=math.Approach(t.angle.p,s and-5 or 0,RealFrameTime()*(s and 10 or 300))t.angle.y=math.Approach(t.angle.y,s and 6.5 or 0,RealFrameTime()*(s and 10 or 300))end end;if self.VElements then self.ShellEjectTime=self.ShellEjectTime or 0;self.ShellInsertTime=self.ShellInsertTime or 0;local u=self.VElements["grenade"]local v=self.VElements["grenade_ej"]local g=self.VElements["grenade_hand"]local w=0;local x=0;if self.ShellEjectTime~=0 and self.ShellEjectionTable then if self.ShellEjectTime>=CurTime()then w=math.Clamp(1-(self.ShellEjectTime-CurTime())/(self.ShellEjectDuration or 0.3),0,1)w=w^1.5;v.pos=m(w,v.def_pos,v.def_pos+o*-35+p*w*23+self.ShellEjectionTable[1].pos*w)v.angle=n(w,v.def_angle,v.def_angle+self.ShellEjectionTable[1].ang*w)v.hide=false;u.hide=true;if self.DrawSmoke and self.DrawSmoke<=CurTime()and w<=0.7 then self.DrawSmoke=CurTime()+0.05;local 